clear ; close all; clc%% Load Data%  The first two columns contains the X values and the third column%  contains the label (y).data = load('ex2data2.txt');X = data(:, [1, 2]); y = data(:, 3);X = mapFeature(X(:,1), X(:,2));% Initialize fitting parametersinitial_theta = zeros(size(X, 2), 1);% Set regularization parameter lambda to 1lambda = 1;% Compute and display initial cost and gradient for regularized logistic% regression[cost, grad] = costFunctionReg(initial_theta, X, y, lambda);fprintf('Cost at initial theta (zeros): %f\n', cost);fprintf('Expected cost (approx): 0.693\n');fprintf('Gradient at initial theta (zeros) - first five values only:\n');fprintf(' %f \n', grad(1:5));fprintf('Expected gradients (approx) - first five values only:\n');fprintf(' 0.0085\n 0.0188\n 0.0001\n 0.0503\n 0.0115\n');fprintf('\nProgram paused. Press enter to continue.\n');pause;% Compute and display cost and gradient with non-zero thetatest_theta = ones(size(X,2),1);[cost, grad] = costFunctionReg(test_theta, X, y, lambda);fprintf('\nCost at test theta: %f\n', cost);fprintf('Expected cost (approx): 2.13\n');fprintf('Gradient at test theta - first five values only:\n');fprintf(' %f \n', grad(1:5));fprintf('Expected gradients (approx) - first five values only:\n');fprintf(' 0.3460\n 0.0851\n 0.1185\n 0.1506\n 0.0159\n');fprintf('\nProgram paused. Press enter to continue.\n');pause;